import React  from 'react';
import PropTypes from 'prop-types';
import { Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, Collapse, NavDropdown } from 'reactstrap';

import IBase from '../Base.js'
import _ from 'lodash';

const propTypes = {
    brand: PropTypes.string,
    color: PropTypes.string,
    navItems: PropTypes.arrayOf(PropTypes.exact({
                                    name: PropTypes.string,
                                    link: PropTypes.string
                                  }))
};

const defaultProps = {
    brand: "Brand",
    color: "light",
    navItems: []
};

class INav extends IBase {

  toggleNavbar = () => {this.setState({visible: !this.state.visible});}

  render() {
    let {
      brand,
      color,
      navItems,
      ...attributes
    } = this.props;

    navItems = _.map(navItems, (navItem) => {
                           return (<NavItem><NavLink href={navItem.link}>{navItem.name}</NavLink></NavItem>);
                      });

    const nav = (
      <Navbar color={color} light expand="md">
        <NavbarBrand href="/" className="mr-auto"> {brand} </NavbarBrand>
        <NavbarToggler onClick={this.toggleNavbar} className="mr-2" />
        <Collapse isOpen={this.state.visible} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem><NavLink href="/">"q"</NavLink></NavItem>
            <NavItem><NavLink href="/">"q"</NavLink></NavItem>
            <NavItem className="dropdown">
                <a class="nav-link dropdown-toggle" href="#" data-bs-toggle="dropdown">  Treeview menu  </a>
                <ul className="dropdown-menu"><NavItem className="dropdown-item"> 1 </NavItem> <NavItem className="dropdown-item"> 2</NavItem></ul>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    );

    const navbar = (
        <Navbar inverse collapseOnSelect className="nav-bar">
                  <Navbar.Header>
                    <Navbar.Brand>
                      <a href="#">efrt</a>
                    </Navbar.Brand>
                    <Navbar.Toggle />
                  </Navbar.Header>
                  <Navbar.Collapse>
                    <Nav>
                      <NavItem eventKey={1} href="#">
                        Features
                      </NavItem>
                      <NavItem eventKey={2} href="#">
                        Who we Are
                      </NavItem>
                    </Nav>
                    <Navbar.Form pullRight />
                    <Nav pullRight>
                      <NavDropdown eventKey={3} title="Signup" id="basic-nav-dropdown">
                        <MenuItem eventKey={3.3}>Member</MenuItem>
                        <MenuItem divider />
                        <MenuItem eventKey={3.3}>Coach</MenuItem>
                      </NavDropdown>
                    </Nav>
                  </Navbar.Collapse>
                </Navbar>
    )

    return super.render(navbar);
  }
}

INav.propTypes = propTypes;
INav.defaultProps = defaultProps;
INav.displayName = 'INav';

export default INav;
